// MyBarChart.js
import React from 'react';
import {
	XYPlot,
	XAxis, // Shows the values on x axis
	YAxis, // Shows the values on y axis
	VerticalBarSeries,
	LabelSeries
} from 'react-vis';

export default function BarGraph(props) {
	const data = props.data;
	const chartWidth = 800;
	const chartHeight = 500;
	const chartDomain = [0, ];
	return (
		<XYPlot
			xType="ordinal"
			width={chartWidth}
			height={chartHeight}
			yDomain={chartDomain}
		>
			<XAxis />
			<YAxis />
			<VerticalBarSeries
				data={data}
			/>
			<LabelSeries
				data={data.map(obj => {
					return { ...obj, label: obj.y.toString() }
				})}
				labelAnchorX="middle"
				labelAnchorY="text-after-edge"
			/>
		</XYPlot>
	);
}
